import {
    BrowserRouter as Router,
    Routes,
    Route,
    Navigate,
  } from "react-router-dom";
  
  impo
  
  const NavigationRoute = () => {
    return (
      <div>
        <Router>
    
          <Routes>
            <Route path="/" element={<Navigate to="/Home" />} />
            <Route path="/Home" element={<Home/>}/>
          </Routes>
        </Router>
      </div>
    );
  };
  
  export default NavigationRoute;
